import React, { useState } from "react";
import { Route } from "react-router-dom";

/* Begin Import Components */
import ProductList from "./components/admin-components/productList.js";
import ProductCreate from "./components/admin-components/productCreate.js";
import ProductDelete from "./components/admin-components/productDelete.js";
import ProductEdit from "./components/admin-components/productEdit.js";
/* End Import Components */

function App(props) {
  const [authTokens, setAuthTokens] = useState();
  
  const setTokens = (data) => {
    localStorage.setItem("tokens", JSON.stringify(data));
    setAuthTokens(data);
  }

  return (
    <div className="container">
        {/* Begin Routes */}
        <Route path="/products/" exact component={ProductList} />
        <Route path="/products/add" exact component={ProductCreate} />
        <Route path="/products/:id/delete" exact component={ProductDelete} />
        <Route path="/products/:id/edit" exact component={ProductEdit} />
        {/* End Routes */}
    </div>
  );
}

export default App;
